import React from "react";
import { FormGroup } from "reactstrap";

const NewNoteForm = () => {
  return (
    <Form>
      <FormGroup>
        <Label>Which project is this for?</Label>
        <Input type="text" placeholder="Enter Project Name" />
      </FormGroup>
    </Form>
  );
};
